import React, { Component } from "react";
import { connect } from "react-redux";
import "./App.css";

class App extends Component {
  render() {
    const { page, user } = this.props;
    return (
      <div className="App">
        <header className="App-header">
          <h1 className="App-title">My top photos</h1>
        </header>
        <p className="App-intro">There are my liked photos</p>
        <p>My name is {this.props.user.name}</p>
        <p>
          You have {this.props.page.photo.length} photos in{" "}
          {this.props.page.year}
        </p>
      </div>
    );
  }
}

const mapStateToProps = state => {
  console.log(state);
  return {
    user: state.user,
    page: state.page
  };
};

export default connect(mapStateToProps)(App);
